function VideoPreview(file) {
  useEffect(() => {
    fetch("/files/" + file)
      .then((res) => res.json())
      .then((data) => {
        let divs = [];
        data.array.forEach(element => {
          divs.push(
          <div 
            key={element}
            className="file-preview__container"
            onClick={() => showPreview(element)}
          >
            <h1>{element}</h1>
          </div>
          );
        });
        setData(divs);
      })
  }, []);
  return (
    <div>{file}</div>
  )
}

export default VideoPreview;
